import { Children, createContext,useContext } from "react";
const dropContext = createContext();


function Dropvalue(){
    const value = useContext(dropContext)
    return value
}

function DropContext(){
    return(
        <dropContext.Provider >
            {Children}
        </dropContext.Provider>
    )
}

export {Dropvalue,DropContext}
